function buildSlots()
{
		var min = 0,
		    max = 161,
		    select = document.getElementById('slots'),
		wiki_select = document.getElementById('wiki_slots');
		//alert(select)
		for (var i = min; i<=max; i++){
		    var opt = document.createElement('option');
		    opt.value = i;
		    opt.innerHTML ="Slot : " + (6+i);
		    
		    select.appendChild(opt);
		    
		    var opt = document.createElement('option');
		    opt.value = i;
		    opt.innerHTML ="Slot : " + (6+i);
		    wiki_select.appendChild(opt);
		}
}


function changeFunc() {
	var selectBox = document.getElementById("slots");
	var index = selectBox.options[selectBox.selectedIndex].value;
//alert(index);

	select = document.getElementById('reals');	
	select.innerHTML = reals[index];
	
	select = document.getElementById('predicts');	
	select.innerHTML = predicts[index];
	
	select = document.getElementById('contradicts');	
	select.innerHTML = contradicts[index];
	
	var accuracy = contradicts[index].split(",").length;
	//alert("dd" + accuracy);
	accuracy = (10 - accuracy /2 ) * 10;
	//alert(accuracy)
	select = document.getElementById('acc');	
	//alert(select);
	select.innerHTML = accuracy + "%"
	
	accuracy = contradicts[index].split(",").length;
	if ( accuracy ==1 ) accuracy =0;
	//alert(accuracy);
	accuracy = (10 - accuracy /2 ) * 10;
	//alert(accuracy);
	select = document.getElementById('acc');
	//alert(select);
	select.innerHTML = accuracy + "%"
	
}

function changeFuncWiki() {
